import React from 'react';

function FilterYear(props) {
    return (
        <div 
            
            
            style={{
                display: "flex",
                width: "93%",
                height: 50,
                fontSize: 20,
                margin: 20,
                justifyContent: 'space-between',
                alignItems: 'center',
            }}
        >
            <b
            
            style={{
                color: 'white'
            }}
            >Filter by year</b>
            <select
                style={{
                    color: 'black',
                    width: 190,
                    borderRadius: 5,
                    right: 0,
                    height: 50,
                    fontSize: 20,
                    textAlign: 'center'
                }}
            >
                <option value="">
                    <b>{props.year}</b>
                </option>
            </select>
        </div>
    );
}

export default FilterYear;
